import React, { Component } from 'react';
import "./content.css";
import Image from "../images/portfolio1min.png";

class Content extends Component {
  render() {
    return (
      <div className="content">
        <img className="homeImage" src={Image} ></img>
        <div className="homeText" id="homeName">
          Elizabeth Regas
        </div>
        <div className="homeText">
          Developer. Designer.
        </div>
        <div className="homeText">
          Manipulator of the DOM.
        </div>
      </div>
    );
  }
}

export default Content;
